window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author Raymond L. Weil comes the third book in the Star Cross series. </p> <p>The situation in the galaxy is growing desperate. Every day the Vorn are harvesting world after world to be used as food for their Queens. The Vorn ships are nearly indestructible and destroying every fleet that dares to oppose them. </p> <p>Lakiam Fleet Commodore Dreen is trying to form an alliance to try to stop the Vorn, but he needs a victory to bring other Protector Worlds to his side. </p> <p>Fleet Admiral Kurt Vickers undertakes a daring journey to the center of the galaxy seeking a half-mythical race that might just have the secret to stopping the Vorn. However, the mission goes horribly wrong, and he might never see Newton or Earth again. </p>"; 
